import React, { useEffect } from 'react';

const MapComponent = ({ destination }) => {
  useEffect(() => {
    if (destination && window.google && window.google.maps) {
      const map = new window.google.maps.Map(document.getElementById('map'), {
        zoom: 15,
        center: { lat: destination.latitude, lng: destination.longitude },
      });

      const marker = new window.google.maps.Marker({
        position: { lat: destination.latitude, lng: destination.longitude },
        map: map,
      });

      // Define the circle or polygon based on the destination's radius or other properties
      const circle = new window.google.maps.Circle({
        map: map,
        radius: destination.details.radius || 1000, // Example radius
        center: { lat: destination.latitude, lng: destination.longitude },
        fillColor: '#FF0000',
        fillOpacity: 0.35,
        strokeColor: '#FF0000',
        strokeOpacity: 0.8,
        strokeWeight: 2,
      });

      circle.setMap(map);
    }
  }, [destination]);

  return <div id="map" style={{ height: '400px', width: '100%' }}></div>;
};

export default MapComponent;
